import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';

import HomePage from './homeSection/HomePage';
import Product from './singlePageSection/Product';
import Cart from './cartSection/Cart';
import Kitchen from './kitchenSection/Kitchen';
import SearchScreen from './dalle/SearchScreen';
import RidersPage from './dispatchRiders/RidersPage';
import RiderCard from './dispatchRiders/RiderCard';
import Profile from './profile/Profile';
import Order from './orderPage/Order';
import { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [carouselData, setCarouselData] = useState([]);
  const [query, setQuery] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      try {
        const userResponse = await axios.get(
          `http://localhost:5000/api/users?page=${query}`
        );

        setCarouselData(userResponse.data);
        console.log('now', user )
      } catch (error) {
        console.log('Error fetching data:', error);
      }
    };

    fetchData();
  }, [query]);

  console.log('query:', query )
  return (
    <BrowserRouter>
      <div>
        <Routes>
          <Route
            path="/"
            element={
              <HomePage
                query={query}
                setQuery={setQuery}
                carouselData={carouselData}
              />
            }
          />
          <Route path="/product/:id" element={<Product />} />
          <Route path="/cart" element={<Cart />} />
          <Route path="/kitchen" element={<Kitchen />} />
          <Route path="/search" element={<SearchScreen query={query}
                setQuery={setQuery}
                carouselData={carouselData} />} />
          <Route path="/riders" element={<RidersPage />} />
          <Route path="/ride" element={<RiderCard />} />
          <Route path="/profile" element={<Profile />} />
          <Route path="/order" element={<Order />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
